import React, { useState, useEffect } from "react";
import Axios from "axios";
const App = () => {
  const [movie, setMovie] = useState({});

  useEffect(async => {
    Axios.get(
      "https://api.themoviedb.org/3/search/movie?api_key=fac34116c639f3e75cd5205251be421c&query=search"
    ).then(json => setMovie(json.data.results));
  }, []);

  return <h1>{}</h1>;
};

export default App;
